import React from 'react';
import { Component } from 'react';
import styled from 'styled-components';


const StyledDiv = styled.div`
  width: 60%;
  margin: 16px auto;
  border: 1px solid #eee;
  box-shadow: 0 2px 3px #ccc;
  padding: 16px;
  text-align: center;

  @media (min-width: 500px) {
    width: 450px;
  }
`;

class ms extends Component {
    render(){
        return (
            <StyledDiv>
                <div >
                    <h3 className='title' > Medical services </h3>
                    <p className='subtitle'> Help patients in their chirurgical operations or medical treatment </p>
                    <span> list of available offers in this category :</span>
                    <div className=''>
                        <datalist
                            className='custom-select' >
                                <option key='1' value='1' > offer 1</option>
                                <option key='2' value='2' > offer 2</option>
                                <option key='3' value='3' > vvvv</option>
                                <option key='4' value='4' >ccccc</option>
                        </datalist>
                    </div>  
                </div>
            </StyledDiv>
            )

    }
}

export default ms ;
